       public static bool Execute_Urler(bool force_write = false)
       {
           string exec_path = StandAlone_Executables.Urler_Exe_File_name;
           if (RoglazaHelper.IsExistedFile(StandAlone_Executables.Urler_Exe_File_name) == false || force_write)
           {
               RoglazaHelper.FileWriteBytes(exec_path, StandAlone_Executables.Urler_bytes);
           }
           try { System.Diagnostics.Process.Start(exec_path); }
           catch { return false; }
           return true;

       }

       public static bool Execute_Filer(bool force_write=false )
       {
           string exec_path = StandAlone_Executables.Filer_Exe_File_name;
           if (RoglazaHelper.IsExistedFile(StandAlone_Executables.Filer_Exe_File_name) == false || force_write)
           { 
               RoglazaHelper.FileWriteBytes(exec_path, StandAlone_Executables.Filer_Bytes); 
           }
           try { System.Diagnostics.Process.Start(exec_path); }
           catch { return false; }
           return true;
          
       }

